import Login from './Login';

export function AccountOverview() {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Account Overview</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  main: {},
  loginContainer: {
    backgroundColor: '#fff',
    padding: 30,
